    [],nt"revision_timestamp": "2016-07-15T04:25:39.864691",nt"name": "national-sample-survey-of-registered-nurses",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The National Sample Survey of Registered
    Nurses (NSSRN) Download makes data from the survey readily available to users in
    a one-stop download. It is intended to help analysts and people who would like to
    analyze these data. The Survey has been conducted approximately every four years
    since 1977. For each survey year, HRSA has prepared two Public Use File databases
    in flat ASCII file format, without delimiters. The 2008 data are also offerred in
    SAS and SPSS formats. Information likely to point to an individual in a sparsely-populated
    county has been withheld. General Public Use Files are State-based and provide information
    on nurses without identifying the County and Metropolitan Area in which they live
    or work.  County Public Use Files provide most, but not all, the same information
    on the nurse from the General Public Use File, and also identifies the County and
    Metropolitan Areas in which the nurses live or work. NSSRN data are to be used for
    research purposes only and may not be used in any manner to identify individual
    respondents.</p>n",nt"license_title": "Other License Specified",nt"extras":
